import React from 'react';
import {link} from 'react-scroll';
function Navbar() {
  return (
    <nav className='navbar'>
<ul className='nav1'>
    <li className="nav2"><img style={{height:25,position:'relative',left:-5}} src='./images/homee.png' alt=""/><link  activeClass="active"
            to="home"
            spy={true}
            smooth={true}
            offset={-70}
            duration={500} style={{position:'relative',top:-7}}>Home</link></li>
    <li className="nav2" style={{fontSize:18,fontWeight:800}}>|</li>
    <li  className="nav2"><link  activeClass="active"
            to="about"
            spy={true}
            smooth={true}
            offset={-70}
            duration={500} >About</link></li>
    <li className="nav2" style={{fontSize:18,fontWeight:800}}>|</li>
    <li className="nav2"><link to="team" spy={true} smooth={true} offset={50} duration={500}>Our Team</link></li>
    <li className="nav2" style={{fontSize:18,fontWeight:800}}>|</li>
    <li className="nav2"><a href="/#">Activities</a></li>
    <li className="nav2" style={{fontSize:18,fontWeight:800}}>|</li>
    <li className="nav2"><a href="/#">Appointments</a></li>
    <li className="nav2" style={{fontSize:18,fontWeight:800}}>|</li>
    <li className="nav2"><a href="/#">Contact Us</a></li>
    <li className="nav2" style={{fontSize:18,fontWeight:800}}>|</li>
    <li className="nav2"><link  activeClass="active"
            to="FAQ"
            spy={true}
            smooth={true}
            offset={-70}
            duration={500} >FAQ's</link></li>
    <li className="nav2" style={{fontSize:18,fontWeight:800}}>|</li>
    <li className="nav2" ><img id="mail1"style={{position:'relative',top:-3}} src='./images/email.png' alt=""/></li>
   </ul>
    </nav>
  )
}

export default Navbar
